import React from 'react';
// import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import { Avatar } from '@material-ui/core';
import Left_sb_option from './Left_sb_option';
import FlagIcon from '@material-ui/icons/Flag';
import SecurityIcon from '@material-ui/icons/Security';
import PeopleIcon from '@material-ui/icons/People';
import GroupAddIcon from '@material-ui/icons/GroupAdd';

function Left_side_bar() {
  return (
    <div>
      <div className='left_sb_option'>
        <Left_sb_option
          Icon={
            <Avatar src='https://scontent.fdac31-1.fna.fbcdn.net/v/t1.0-1/cp0/p40x40/77001283_557475788129197_2099337519878373376_o.jpg?_nc_cat=100&ccb=2&_nc_sid=7206a8&_nc_eui2=AeH5LlRarhn40Q22k2n0K30BAAMcC2wWA54AAxwLbBYDntLJmRqb7wPbggrYgr2qxD8sZ1iARmVTVrXHMPozYKtO&_nc_ohc=u3sNR6HOtcIAX9Bigb4&_nc_ht=scontent.fdac31-1.fna&tp=27&oh=29b70e1f4a05bce2eb767079fb7e49ad&oe=5FB866EA' />
          }
          name='Ritam Rahman'
        />
        <Left_sb_option
          Icon={<FlagIcon style={{ fontsize: 'xx-large', color: '#1877f2' }} />}
          name='Page'
        />
        <Left_sb_option
          Icon={
            <SecurityIcon style={{ fontsize: 'xx-large', color: '#1877f2' }} />
          }
          name='COVID-19 Information Centre'
        />
        <Left_sb_option
          Icon={
            <PeopleIcon style={{ fontsize: 'xx-large', color: '#1877f2' }} />
          }
          name='Friends'
        />
        <Left_sb_option
          Icon={
            <GroupAddIcon style={{ fontsize: 'xx-large', color: '#1877f2' }} />
          }
          name='Groups'
        />
      </div>
    </div>
  );
}

export default Left_side_bar;
